import React, { Component } from "react";
// import ReactDOM from "react-dom";
import Navigation from '../Navigation/Navigation';
import './Home.css';

class MyApp extends Component {
  constructor(props) {
    super(props);
    this.state = {

    };
    this.loadResponse = this.loadResponse.bind(this);
  }

  componentDidMount() {
    fetch()
      .then (res => res.json)
  }

  async loadResponse() {
    let response =
        await fetch('https://api.instagram.com/v1/self/media/recent', {
          method: 'GET',
          headers: new Headers({
            'access_token': 'ace955756b3b4727b4fd926fbd8f563b',
            'Content-Type': 'application/json'
          }),
        });
    if (response.status == 200) {
      let json = await response.json(); // (3)
      console.log('hello');
      return json;
    }
  }
  render() {
    this.loadResponse();
    return (
      <Navigation />
    );
  }
}

export default MyApp;
